import React, { useState, useEffect } from 'react';

const Barres = () => {
  const [barRes, setBarRes] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8080/api/barres')
      .then(response => response.json())
      .then(data => setBarRes(data));
  }, []);

  return (
    <div>
      {barRes.map(barRes => (
        <div key={barRes.barResId}>
          <h2>{barRes.barResName}</h2>
          <p>{barRes.barResLocation}</p>
        </div>
      ))}
    </div>
  );
};

export default Barres;
